INSERT INTO [DonationAppDb].[dbo].[DonationTypes]
([Id], [Name], [Description], [Requirements], [Process], [Importance], [Benefits], [SecondaryEffects], [Image])
VALUES
(
    '5fbd9af3-9a3e-4f24-b916-cb792c9cb404', 
    'Mdula sea',
    'La mdula sea es un tejido esponjoso que se encuentra dentro de algunos huesos, como el esternn o la pelvis. Produce clulas madre hematopoyticas, que se transforman en:\n Glbulos rojos (transportan oxgeno)\n Glbulos blancos (luchan contra infecciones)\n Plaquetas (ayudan a la coagulacin)\n La donacin de mdula sea permite extraer clulas madre hematopoyticas esenciales para curar enfermedades como la leucemia o linfoma. Puede realizarse por sangre perifrica o por puncin directa del hueso de la cadera.',
    ' Edad: 18-40 aos.\n Buen estado de salud. No tener enfermedades crnicas, autoinmunes, infecciosas, etc.\n Registro como donante voluntario.\n Peso saludable.\n No haber padecido enfermedades graves o inmunolgicas.',
    '1. Aferesis: Se administra un medicamento durante 4-5 das para movilizar las clulas madre al torrente sanguneo. Luego se extraen mediante una mquina especial.\n2. Extraccin directa: Se realiza bajo anestesia general, extrayendo mdula del hueso de la cadera mediante punciones. Procedimiento indoloro y seguro.',
    'Es la nica opcin curativa para muchas enfermedades de la sangre como: leucemia, linfomas, mieloma mltiple, aplasia medular y otras enfermedades graves de la sangre. La compatibilidad entre personas no emparentadas es muy baja, por lo que se necesita una gran cantidad de donantes registrados para aumentar las probabilidades de salvar vidas.',
    ' Salvar vidas.\n Satisfaccin personal.\n Reforzar la solidaridad y cultura de donacin.\n No conlleva dao permanente al donante.',
    ' Dolor leve en huesos o zona lumbar.\n Cansancio o molestias temporales.\n Reacciones leves al medicamento movilizador.\n Riesgos mnimos asociados a anestesia en el caso de puncin.',
    'data:image/jpeg;base64,'
),
(
	'94088d4a-b1d8-4c33-a629-1681d21b01ba', 
	'Sangre', 
	'La donacin de sangre es un acto voluntario y altruista en el cual una persona proporciona una cantidad de su sangre para ser utilizada en transfusiones o en la elaboracin de componentes sanguneos para pacientes que lo necesitan.', 
	' Tener entre 18 y 65 aos.\n Pesar ms de 50 kg.\n Estar en buen estado de salud general.\n No haber donado sangre en los ltimos 3 meses (hombres) o 4 meses (mujeres).\n No estar tomando antibiticos ni haber tenido infecciones recientes.\n No haber tenido prcticas de riesgo de transmisin de enfermedades.\n No estar embarazada ni en perodo de lactancia (segn el tiempo postparto).', 
	'1. Registro y entrevista mdica: le harn preguntas sobre su salud, estilo de vida y antecedentes mdicos.\n2. Prueba de hemoglobina: Un pinchazo en el dedo para medir sus niveles de hierro.\n3. Donacin: Se extraen aproximadamente 450 ml de sangre en unos 8-10 minutos.\n 4. Recuperacin: Descansas unos minutos y recibes un refrigerio.', 
	' Una sola donacin puede salvar hasta 3 vidas.\n  Se utiliza en:\n Cirugas.\n Accidentes graves.\n Tratamientos de cncer.\n Transfusiones en partos o enfermedades como la anemia.\n La sangre no se puede fabricar: solo puede obtenerse por medio de donaciones humanas.',
	' Satisfaccin emocional al saber que ests salvando vidas.\n Recibes un chequeo mdico bsico (presin arterial, hemoglobina, deteccin de enfermedades).\n Estimula la produccin de nuevas clulas sanguneas.\n Es un proceso seguro y controlado.', 
	'La mayora de las personas no presentan problemas, pero pueden aparecer:\n Mareos o debilidad leve, sobre todo si no se ha comido adecuadamente antes.\n Pequeo hematoma en el lugar del pinchazo.\n Cansancio temporal.\n En raros casos: desmayo o bajada de presin. Consejos para prevenir efectos secundarios:\n Hidrtate bien antes y despus.\n Come algo ligero antes de donar.\n Descansa unos minutos despus de la extraccin.', 
	'data:image/jpeg;base64,'
),
(
    '8a1d9e25-7e02-42e9-bc0c-d4724f2f61e9',
    'Rin',
    'La donacin de rin puede realizarse en vida o tras la muerte. Es uno de los trasplantes ms comunes y exitosos. Permite a personas con insuficiencia renal crnica recuperar su calidad de vida.',
    ' Tener entre 18 y 65 aos (en vida).\n Buena salud general.\n Ser compatible con el receptor.\n No padecer enfermedades crnicas o graves.\n Evaluacin mdica, psicolgica y social completa.\n Consentimiento informado.\n En fallecidos: voluntad previa o autorizacin familiar.',
    'Donacin en vida: Se realiza una evaluacin completa y ciruga laparoscpica para extraer un rin.\nDonacin post mortem: Tras la muerte cerebral, el rgano se extrae y se preserva para trasplante.',
    'Permite a los pacientes renales dejar la dilisis, prolongar su vida y mejorar su estado general. Un rin sano puede suplir completamente la funcin renal.',
    ' Receptor: Mayor calidad de vida, sin dependencia de dilisis.\n Donante: Satisfaccin emocional por salvar una vida, controles mdicos gratuitos en muchos sistemas de salud.',
    ' Donante vivo: Riesgos quirrgicos leves, dolor temporal, fatiga, riesgo muy bajo de fallo renal.\n Donante fallecido: Sin efectos adversos.',
    'data:image/jpeg;base64,'
),
(
    'a4c39e91-b960-4f31-850c-1ad3d9bc6dcb',
    'Hgado',
    'La donacin de hgado puede realizarse en vida (parcial) o tras la muerte (completo). Es posible porque el hgado tiene capacidad de regenerarse. Es vital para pacientes con enfermedades hepticas graves.',
    ' Edad: 18-60 aos (en vida).\n Buena salud general.\n Compatible con el receptor (grupo sanguneo, pruebas inmunolgicas).\n Sin enfermedades hepticas, infecciosas o cardiovasculares.\n Evaluaciones mdicas y psicolgicas completas.\n Consentimiento informado voluntario.\n En donacin cadavrica: muerte enceflica y voluntad previa o familiar.',
    'Donacin en vida: Se extirpa quirrgicamente una parte del hgado. Ambos hgados se regeneran en pocas semanas.\nDonacin post mortem: Se extrae el hgado completo tras certificacin de muerte cerebral y se trasplanta rpidamente.',
    'Es una opcin vital para salvar vidas de pacientes con enfermedades hepticas crnicas o agudas. El hgado es el nico rgano que puede regenerarse, lo que permite donaciones parciales entre vivos.',
    ' Receptor: Mejor calidad y esperanza de vida.\n Donante: Acto altruista de gran valor. El hgado se regenera por completo.\n Fortalece la cultura de donacin.',
    ' Dolor abdominal postoperatorio.\n Infecciones, sangrado o complicaciones quirrgicas.\n Fatiga.\n Riesgo muy bajo de dao heptico permanente.\n Cicatrices visibles.',
    'data:image/png;base64,'
),
(
    'b72dbd13-04aa-42e1-8825-4e52dfbaebcd',
    'Pulmn',
    'La donacin de pulmn puede realizarse en vida (un lbulo) o despus de la muerte (pulmones completos). Permite tratar enfermedades pulmonares terminales y mejora significativamente la calidad de vida del receptor.',
    ' Donante vivo: Edad entre 18-60 aos.\n Salud pulmonar ptima.\n No fumador.\n Compatible con el receptor.\n Evaluacin mdica y psicolgica.\n Consentimiento informado.\n Donante fallecido: muerte cerebral confirmada, pulmones funcionales, sin antecedentes de enfermedades respiratorias graves.',
    'En vida: Se extrae un lbulo pulmonar, generalmente con apoyo de otro donante vivo.\nPost mortem: Se extraen ambos pulmones tras confirmacin de muerte cerebral, se evalan y trasplantan en cuestin de horas.',
    'Es la nica alternativa para personas con enfermedades pulmonares terminales como fibrosis qustica, EPOC o fibrosis pulmonar idioptica. Permite salvar vidas y recuperar funciones respiratorias.',
    ' Receptor: Mejor calidad de vida y capacidad respiratoria.\n Donante vivo: Salvacin de vida de un ser querido.\n Donante fallecido: Posibilidad de salvar hasta dos personas.',
    ' Donante vivo: Riesgos quirrgicos, dolor torcico, disminucin temporal de la capacidad pulmonar.\n Donante fallecido: No presenta riesgos.',
    'data:image/jpeg;base64,'
),
(
    'e0b6d4e7-ccf5-4fc2-85c1-c46a3a1e93d1',
    'Corazn',
    'La donacin de corazn solo puede realizarse tras la muerte enceflica del donante. Es vital para personas con insuficiencia cardaca terminal. El rgano debe extraerse y trasplantarse en pocas horas.',
    ' Donante fallecido con muerte enceflica confirmada.\n Corazn funcional y sin enfermedades previas.\n Compatible con el receptor (grupo sanguneo, tamao corporal).\n Evaluacin mdica completa.\n Consentimiento del donante o su familia.',
    'Tras la confirmacin de muerte cerebral, se extrae el corazn en un quirfano especializado. El rgano se conserva en fro y debe trasplantarse en un plazo de 4-6 horas.',
    'Es la nica alternativa para pacientes con enfermedades cardacas terminales. Un corazn sano puede salvar una vida en cuestin de horas.',
    ' Receptor: recuperacin de la funcin cardaca, mayor esperanza de vida.\n Donante fallecido: legado de vida, posibilidad de salvar mltiples vidas con distintos rganos.',
    ' Donante fallecido: sin efectos.\n Receptor: riesgo de rechazo, infecciones, necesidad de inmunosupresin y seguimiento mdico constante.',
    'data:image/jpeg;base64,'
),
(
    'bf5b5e0a-0f4f-4762-bb2a-8db5d0d6fbd5',
    'Intestino Delgado',
    'La donacin de intestino delgado puede realizarse en vida o tras la muerte. Est indicada en casos de fallo intestinal grave, especialmente en nios con sndrome de intestino corto.',
    ' Donante vivo: 18-60 aos, buena salud digestiva, compatible con el receptor, sin enfermedades gastrointestinales, evaluacin mdica y psicolgica completa, consentimiento firmado.\n Donante fallecido: muerte enceflica, intestino funcional, sin enfermedades graves, compatibilidad con el receptor.',
    'En vida: se extrae una seccin del intestino delgado (como el leon) y el donante puede continuar con una dieta adaptada.\nPost mortem: el intestino se evala y se trasplanta en pocas horas tras la extraccin.',
    'Es esencial para pacientes con fallos intestinales graves, que dependen de nutricin parenteral. En muchos casos, es la nica forma de supervivencia, especialmente en la infancia.',
    ' Receptor: recuperacin de la funcin intestinal, independencia de nutricin parenteral, mejora de calidad de vida.\n Donante: contribuye de forma directa a salvar una vida, especialmente si es familiar del receptor.',
    ' Donante vivo: dolor postoperatorio, complicaciones digestivas, alteraciones en la absorcin.\n Receptor: riesgo de rechazo, infecciones y necesidad de seguimiento permanente.',
    'data:image/jpeg;base64,'
),
(
    '9d3a2d74-1bd2-4436-a929-9b176d60ee56',
    'Pncreas',
    'La donacin de pncreas puede hacerse post mortem o, en casos excepcionales, en vida. Se utiliza principalmente para tratar diabetes tipo 1 grave, y puede restaurar la produccin natural de insulina.',
    ' Donante fallecido: muerte enceflica, pncreas sano, sin diabetes ni pancreatitis, compatible con el receptor.\n Donante vivo: joven, sano, evaluacin exhaustiva, slo en centros especializados.',
    'En donacin post mortem, el pncreas se extrae tras confirmacin de muerte cerebral y se conserva en fro hasta su trasplante. En donacin en vida, se extrae una porcin del rgano mediante ciruga mayor.',
    'Es fundamental para pacientes con diabetes tipo 1 severa o combinada con fallo renal. Puede eliminar la necesidad de insulina y mejorar la calidad de vida.',
    ' Receptor: independencia de insulina, mejora metablica, reduccin de complicaciones diabticas.\n Donante: satisfaccin emocional por salvar o mejorar una vida.',
    ' Donante vivo: riesgo quirrgico, posible aparicin de diabetes.\n Receptor: riesgo de rechazo, infecciones e inmunosupresin de por vida.',
    'data:image/jpeg;base64,'
),
(
    '6a2d6f1a-b6f6-4d8e-b0c5-3b3c71e7eab3', 
    'Crneas',
    'La donacin de crneas es el trasplante ms frecuente del mundo. Se realiza post mortem y permite recuperar la visin en personas con enfermedades oculares graves.',
    ' Donacin post mortem con consentimiento previo o autorizacin familiar.\n Muerte natural o enceflica.\n Crneas sanas, sin infecciones ni enfermedades transmisibles.\n Extraccin dentro de las 6 horas del fallecimiento.',
    'Tras la muerte del donante, se extrae la crnea con cuidado, se conserva en medio especial y se traslada al banco de ojos. All se evala y se asigna a un receptor compatible.',
    'Es fundamental para restaurar la visin en pacientes con queratocono, opacidades corneales, traumatismos o enfermedades hereditarias. Aumenta su autonoma e independencia.',
    ' Recuperacin visual parcial o total.\n Mejora en la calidad de vida.\n Procedimiento con alta tasa de xito y baja complejidad quirrgica.',
    ' Posible rechazo inmunolgico.\n Infecciones oculares.\n Alteraciones visuales temporales postoperatorias.\n Necesidad de controles frecuentes.',
    'data:image/jpeg;base64,'
),
(
    'ab6c2f52-4e5c-4fef-99b3-e33a6dcb2cfc', 
    'Piel',
    'La donacin de piel se realiza post mortem y es utilizada principalmente para pacientes con quemaduras graves, lesiones extensas o necesidades reconstructivas de la piel.',
    ' Muerte enceflica o muerte natural confirmada.\n Piel en buen estado, sin infecciones ni enfermedades contagiosas.\n Consentimiento previo del donante o autorizacin familiar.\n Extraccin dentro de las 6-12 horas post mortem.',
    'La piel se extrae de reas extensas del cuerpo, como muslos, abdomen o espalda, y se conserva en soluciones especiales. Luego se trasplanta a los receptores de acuerdo a su condicin mdica.',
    'Es fundamental para salvar vidas en casos de quemaduras severas, y tambin se utiliza en ciruga reconstructiva para restaurar la piel daada o perdida por enfermedades genticas o traumas.',
    ' Mejora en la recuperacin de la funcin protectora de la piel.\n Prevencin de infecciones en pacientes quemados.\n Ayuda en la reconstruccin esttica y funcional de la piel.',
    ' Riesgo de rechazo (aunque es bajo).\n Posibles infecciones postoperatorias.\n Cicatrices y seguimiento mdico a largo plazo.\n Uso limitado en algunos casos debido a la temporalidad del injerto.',
    'data:image/jpeg;base64,'
),
(
    '8b672d34-0b64-4376-b618-c4d8a2f7de37',
    'Huesos',
    'La donacin de huesos es crucial para pacientes con fracturas graves, enfermedades osteognicas o cnceres seos. Permite realizar reemplazos seos y reconstrucciones.',
    ' Muerte enceflica confirmada.\n El donante debe estar libre de infecciones graves y cncer seo.\n Evaluacin de los huesos para asegurar su calidad.\n Extraccin dentro de las primeras 12-24 horas post mortem.',
    'Los huesos son extrados de reas extensas y conservados en condiciones estriles. Posteriormente, se trasplantan para restaurar la funcin sea y articular.',
    'Es fundamental para pacientes con fracturas graves, cncer seo o prdida sea debido a enfermedades degenerativas. Restaura la funcionalidad de las extremidades.',
    ' Recuperacin de la movilidad.\n Mejoramiento de la funcin sea y articular.\n Restaura la integridad sea en fracturas y cirugas reconstructivas.',
    ' Riesgo de rechazo.\n Posibles infecciones.\n Dolor postoperatorio y necesidad de rehabilitacin.\n Reacciones alrgicas a inmunosupresores.',
    'data:image/jpeg;base64,'
),
(
    'f9b3a8a7-219d-4881-b7ad-d85c6c5f460f',
    'Tendones',
    'La donacin de tendones es vital para pacientes con lesiones tendinosas graves. Permite realizar cirugas de reparacin y restaurar la movilidad y funcin motora.',
    ' Muerte enceflica confirmada.\n El donante debe estar libre de infecciones y enfermedades que afecten los tendones.\n Evaluacin de los tendones para asegurar su calidad.\n Los tendones no deben haber sufrido lesiones degenerativas.',
    'Los tendones se extraen de reas grandes y se conservan en soluciones estriles. Posteriormente, se utilizan en cirugas de reparacin tendinosa en pacientes con lesiones o rupturas graves.',
    'Es fundamental para la reparacin de lesiones en rodillas, hombros, tobillos y codos. Permite restaurar la funcionalidad motora de las extremidades.',
    ' Restauracin de la funcin motora.\n Mejora en la recuperacin de lesiones tendinosas graves.\n Aceleracin de la rehabilitacin postquirrgica.',
    ' Riesgo de rechazo.\n Posibles infecciones postoperatorias.\n Dificultades de integracin del injerto.\n Dolor y limitacin de movimiento durante la recuperacin.',
    'data:image/jpeg;base64,'
),
(
    '63d04f7a-2dfd-4d3d-99a0-543f0bc90027',
    'Tejidos',
    'La donacin de tejidos incluye piel, tendones, vlvulas cardacas, vasos sanguneos y otros tejidos que pueden ser utilizados para trasplantes o procedimientos reconstructivos.',
    ' Muerte enceflica confirmada o muerte por causas naturales.\n El donante debe estar libre de enfermedades graves e infecciones.\n Extraccin de los tejidos dentro de las primeras 6-12 horas tras el fallecimiento.\n Evaluacin para asegurar la viabilidad de los tejidos.',
    'Tras la confirmacin de la muerte, se extraen los tejidos necesarios en condiciones estriles. Luego, los tejidos son procesados y conservados antes de ser trasplantados a los receptores adecuados.',
    'Es esencial para la reparacin de quemaduras graves, enfermedades cardacas, lesiones articulares y problemas vasculares. Permite restaurar la funcionalidad de diversos rganos y sistemas corporales.',
    ' Mejora en la recuperacin de la piel en pacientes con quemaduras.\n Aceleracin de la recuperacin en lesiones tendinosas.\n Reparacin de vlvulas cardacas y vasos sanguneos daados.\n Mejora de la calidad de vida de pacientes con problemas vasculares o cardacos.',
    ' Posible rechazo del injerto.\n Riesgo de infecciones postoperatorias.\n Formacin de cicatrices en las reas de extraccin.\n Dificultades de integracin en algunos casos.',
    'data:image/jpeg;base64,'
);

